import React, { useState, useEffect } from "react";
import CellDescription from "./celldescription";

function Cell() {
    useEffect(({ notebookID }) => {
        var notebookRef = firebase.database().ref("notebooks/" + notebookID);
        notebookRef.on("value", (snapshot) => {
          const data = snapshot.val();
          setNotebook(data);
        });
      }, [notebookID]);

    return (
        <div className="cell-container">
            <div className="cell-options"></div>
            <div className="cell-output"> </div>
            <CellDescription />
        </div>
    );
}

export default Cell;
